import SearchForm from '../SearchForm/SearchForm'


function Main(props) {
  return (
    <main className='main'> 
    <div className='main__container'> 
          <div className='main__heading'>What's going on in the world?</div>  
          <div className='main__subheading'>Find the latest news on any topic and save them in your personal account. </div>  
    </div>
      <SearchForm />
      <About />
    </main>
        )
}

export default Main;
